import React from "react";
import styled from "styled-components";
import { Icon } from "./svg/Icon";
import { useDispatch } from "react-redux";
import { nextPage, previousPage } from "../store/pageSlice";

const MenuConteiner = styled.div`
  font-family: "TTFirsNeue400";
  margin: 47px auto 0;
  margin-bottom: -56px;
  width: 648px;
  height: 17px;
  display: flex;
  justify-content: space-between;
  @media (max-width: 768px) {
    display: none;
  }
`;

const ButtonConteiner = styled.div`
  font-size: 14px;
  align-items: center;
  display: flex;
  cursor: pointer;
`;

const RightMenuArrow = styled.div`
  font-size: 14px;
  align-items: center;
  display: flex;
  cursor: pointer;
`;

export default function HeaderMenu() {
  const dispatch = useDispatch();
  return (
    <div>
      <MenuConteiner>
        <ButtonConteiner onClick={() => dispatch(nextPage())}>
          <Icon id="arrow" className="arrow-icon" /> о сотруднике
        </ButtonConteiner>
        <ButtonConteiner onClick={() => dispatch(previousPage())}>
          о компании
          <Icon id="arrow" className="arrow-icon right" />
        </ButtonConteiner>
      </MenuConteiner>
    </div>
  );
}
